import React from 'react';
import { Box, Typography, Grid, Paper, Switch, Slider, IconButton } from '@mui/material';
import { styled } from '@mui/material/styles';
import LightbulbIcon from '@mui/icons-material/Lightbulb';
import BrightnessHighIcon from '@mui/icons-material/BrightnessHigh';
import BrightnessLowIcon from '@mui/icons-material/BrightnessLow';
import WbSunnyIcon from '@mui/icons-material/WbSunny';
import NightlightIcon from '@mui/icons-material/Nightlight';

const RoomCard = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(2),
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  background: theme.palette.mode === 'dark' 
    ? 'linear-gradient(45deg, #9c27b0 30%, #ba68c8 90%)'
    : 'linear-gradient(45deg, #2196f3 30%, #64b5f6 90%)',
  color: '#fff',
  transition: 'transform 0.2s',
  '&:hover': {
    transform: 'scale(1.02)',
  },
}));

interface Room {
  id: string;
  name: string;
  isOn: boolean;
  brightness: number;
  mode: 'day' | 'night' | 'auto';
}

interface LightsPageProps {
  rooms: Room[];
  onToggleRoom: (roomId: string) => void;
  onBrightnessChange: (roomId: string, value: number) => void;
  onModeChange: (roomId: string, mode: Room['mode']) => void;
}

const LightsPage: React.FC<LightsPageProps> = ({
  rooms,
  onToggleRoom,
  onBrightnessChange,
  onModeChange,
}) => {
  return (
    <Box sx={{ pb: 7 }}>
      <Typography variant="h4" gutterBottom>
        Управление освещением
      </Typography>

      <Grid container spacing={3}>
        {rooms.map((room) => (
          <Grid item xs={12} md={6} key={room.id}>
            <RoomCard>
              <Box display="flex" alignItems="center" justifyContent="space-between" mb={2}>
                <Box display="flex" alignItems="center">
                  <LightbulbIcon sx={{ mr: 1 }} />
                  <Typography variant="h6">{room.name}</Typography>
                </Box>
                <Switch
                  checked={room.isOn}
                  onChange={() => onToggleRoom(room.id)}
                  color="primary"
                />
              </Box>

              <Box sx={{ mb: 2 }}>
                <Typography variant="body2" gutterBottom>
                  Яркость
                </Typography>
                <Box display="flex" alignItems="center" gap={1}>
                  <BrightnessLowIcon />
                  <Slider
                    value={room.brightness}
                    onChange={(_, value) => onBrightnessChange(room.id, value as number)}
                    min={0}
                    max={100}
                    valueLabelDisplay="auto"
                    sx={{ flex: 1 }}
                  />
                  <BrightnessHighIcon />
                </Box>
              </Box>

              <Box>
                <Typography variant="body2" gutterBottom>
                  Режим
                </Typography>
                <Box display="flex" gap={1}>
                  <IconButton
                    size="small"
                    onClick={() => onModeChange(room.id, 'day')}
                    color={room.mode === 'day' ? 'primary' : 'default'}
                  >
                    <WbSunnyIcon />
                  </IconButton>
                  <IconButton
                    size="small"
                    onClick={() => onModeChange(room.id, 'night')}
                    color={room.mode === 'night' ? 'primary' : 'default'}
                  >
                    <NightlightIcon />
                  </IconButton>
                  <IconButton
                    size="small"
                    onClick={() => onModeChange(room.id, 'auto')}
                    color={room.mode === 'auto' ? 'primary' : 'default'}
                  >
                    <LightbulbIcon />
                  </IconButton>
                </Box>
              </Box>
            </RoomCard>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default LightsPage;
